import React, { useState } from 'react';
import './header.scss';
import { Link } from "react-router-dom";
import logo from '../../assets/MLI-logo.png'


function Home() {
  const [expanded, setExpanded] = useState(false);

  return (
    // <header className="App-header">
    <nav expanded={expanded} className="navbar navbar-expand-md navbar-light bg-light">
      <Link className="navbar-brand" to="/"><img src={logo} alt="mli-logo" className="logo" /></Link>
      <button onClick={() => setExpanded(expanded ? false : "expanded")} className="navbar-toggle"  data-toggle="collapse" data-target="#navbarMenu">
        <span className="navbar-toggler-icon" ></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarMenu">

        <ul className="navbar-nav ml-auto">
          <li className="nav-item">
            <Link onClick={() => setExpanded(false)} className="nav-link" to="/">Home</Link>
          </li>
          <li className="nav-item">
            <Link onClick={() => setExpanded(false)} className="nav-link" to="about">About</Link>
          </li>
          <li className="nav-item">
            <Link onClick={() => setExpanded(false)} className="nav-link" to="products">Products</Link>
          </li>
          <li className="nav-item">
            <Link onClick={() => setExpanded(false)} className="nav-link" to="contact">Contact</Link>
          </li>
        </ul>
      </div>
    </nav>
    // </header>
  );
}

export default Home;
